import React from 'react';
import { ModalWrapper, ModalBox, StyledFaTimes } from './styles';

const Modal = ({ children, open, onClose }) => {
  return (
    <ModalWrapper
      open={open}
      onClick={onClose}
      onKeyDown={e => console.log(e.value)}
    >
      <ModalBox>
        <StyledFaTimes onClick={onClose} />
        {children}
      </ModalBox>
    </ModalWrapper>
  );
};

export default Modal;
